import { CoreInputBase } from './core-input-base.js';

// @ts-check
/**
 * Basic Text input
 */
export class CoreInputText extends CoreInputBase {
    /** */
    getDataType() {
        this.dataType.fromString(this.getDisplayValue());
        return this.dataType;
    }
}

customElements.define('core-input-text', CoreInputText);
